import {MapContainer, TileLayer, Marker, Popup} from 'react-leaflet';

/**
 * 
 * @param {*} props 
 * @returns Mapa de la api de react-leaflet
 * 
 * esta función devuelve el mapa completo de react leaflet con los marcadores
 * ya puestos 
 */
export const Mapa = (props) => {
  return (
    <>
    <MapContainer center={[43.0000000, -2.7500000]} zoom={9} scrollWheelZoom={false}>
      <TileLayer
        attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      />
      {props.datos !== undefined && props.datos.length !== 0 ? (
      props.datos.map ((marcador,i) => {
          return (
              <>
                <Marker position={[marcador.posY,marcador.posX]}>
                    <Popup>
                      {marcador.cp}
                    </Popup>
                </Marker>
              </>
          );
      })
    ) : null}
    </MapContainer>

    </>
    );
}


export default Mapa;
